package com.Testing;

import static org.junit.Assert.*;

import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

import org.junit.Test;

import com.CustomClasses.FunktionForTesting;
import com.OriginalFiles.Field;
import com.OriginalFiles.Move;

public class MoveTest extends FunktionForTesting {

    public MoveTest() throws InterruptedException, IOException {
        super();
        // TODO Auto-generated constructor stub
    }

    @Test
    public final void testMoveFieldFieldBoolean() {
        Field fromField = new Field(5, 4);
        Field toField = new Field(6, 5);

        Move myMove = new Move(fromField, toField, false);

        assertFalse(myMove.wasKingBefore);
        assertEquals(myMove.moves.get(0), fromField);
        assertEquals(myMove.moves.get(1), toField);
        assertEquals(myMove.takenPieces.size(), 0);
        assertFalse(myMove.isJump());
    }

    @Test
    public final void testMoveListOfFieldBoolean() {
        List<Field> listOfFields = new ArrayList<Field>();

        Field fromField = new Field(1, 0);
        Field toField = new Field(2, 1);

        listOfFields.add(fromField);
        listOfFields.add(toField);

        Move myMove = new Move(listOfFields, false);

        assertFalse(myMove.wasKingBefore);
        assertEquals(myMove.moves, listOfFields);
        assertFalse(myMove.isJump());

       assertEquals(myMove.takenPieces.size(), 0);
    }

    @Test
    public final void testMove() {
        Move myMove = new Move();

        assertEquals(myMove.moves.size(), 0);
        assertFalse(myMove.wasKingBefore);
        assertFalse(myMove.isJump());
    }

    @Test
    public final void testIsJump() {
        Field fromField = new Field(5, 4);
        Field toField = new Field(6, 5);

        Move myMove = new Move(fromField, toField, false);

        assertFalse(myMove.isJump());

        fromField = new Field(5, 4);
        toField = new Field(7, 6);

        myMove = new Move(fromField, toField, false);

        assertTrue(myMove.isJump());
    }

    @Test
    public final void testAddStep() {
        Field fromField = new Field(3, 4);
        Field toField = new Field(4, 5);

        Move myMove = new Move(fromField, toField, false);

        assertEquals(myMove.moves.size(), 2);

        Field newStep = new Field(5, 6);

        myMove.addStep(newStep);

        assertEquals(myMove.moves.size(), 3);
    }
}

package com.Testing;

import static org.junit.Assert.*;

import java.io.IOException;

import org.junit.Test;

import com.CustomClasses.FunktionForTesting;
import com.OriginalFiles.Field;
import com.OriginalFiles.Piece;

public class FieldTest extends FunktionForTesting{
    public FieldTest() throws InterruptedException, IOException {
        super();
        // TODO Auto-generated constructor stub
    }

    Field testField;
    @Test
    public void testField() {
        testField = new Field();
        testConstructor(testField, 0, 0);
    }

    @Test
    public void testFieldIntInt() {
        testField = new Field(1, 2);
        testConstructor(testField, 1, 2);
    }

    private void testConstructor(Field field, int x, int y){
        assertEquals(x, field.x);
        assertEquals(y, field.y);
        field.x = 2;
        field.y = 1;
        assertEquals(2, field.x);
        assertEquals(1, field.y);

        assertFalse(field.allowedField);
        field.allowedField = true;
        assertTrue(field.allowedField);

        assertNull(field.getPieceOnField());
        field.setPieceOnField(producePiece(x, y, 'w', false));
        assertNotNull(field.getPieceOnField());

        assertFalse(field.visited);
        field.visited = true;
        assertTrue(field.visited);
    }

    @Test
    public void testSetPieceOnField() {
        testField = new Field();
        assertNull(testField.getPieceOnField());
        testField.setPieceOnField(new Piece(checkersBoard));
        testFieldsPieceEqPiece(testField, false);

        testField.setPieceOnField(producePiece(1, 2, 'r', true));

        testFieldsPieceEqPiece(testField, true);

        testField.x = 1;
        testField.y = 2;
        testField.setPieceOnField(producePiece(1, 2, 'r', true));
        testFieldsPieceEqPiece(testField, true);
    }

    private void testFieldsPieceEqPiece(Field PieceField, boolean testForTrue){
        Piece tempPiece = PieceField.getPieceOnField();

        assertEquals(PieceField.x, tempPiece.getX());
        assertEquals(PieceField.y, tempPiece.getY());

        if (testForTrue) {
            assertTrue(tempPiece.isCrowned);
            assertTrue(tempPiece.isMoveable);
            assertTrue(tempPiece.canJump);
        } else {
            assertFalse(tempPiece.isCrowned);
            assertFalse(tempPiece.isMoveable);
            assertFalse(tempPiece.canJump);
        }
    }

    @Test
    public void testGetPieceOnField() {
        testField = new Field();
        assertNull(testField.getPieceOnField());
        testField.setPieceOnField(producePiece(1, 2, 'r', true));
        testFieldsPieceEqPiece(testField, true);
    }

    @Test
    public void testIsEmpty() {
        testField = new Field();
        assertTrue(testField.isEmpty());

        testField.setPieceOnField(producePiece(0, 0, 'r', false));
        assertFalse(testField.isEmpty());

        testField.emptyThisField();
        assertTrue(testField.isEmpty());
    }

    @Test
    public void testIsPieceOfColor() {
        testField = new Field();
        testField.setPieceOnField(producePiece(0, 0, 'r', false));
        assertTrue(testField.isPieceOfColor('r'));
        assertFalse(testField.isPieceOfColor('w'));

        testField.getPieceOnField().color = 'g';
        assertFalse(testField.isPieceOfColor('b'));
        assertTrue(testField.isPieceOfColor('g'));
    }

    @Test
    public void testEmptyThisField() {
        testField = new Field();
        assertNull(testField.getPieceOnField());

        testField.setPieceOnField(producePiece(0, 0, 'r', false));
        assertNotNull(testField.getPieceOnField());

        testField.emptyThisField();
        assertNull(testField.getPieceOnField());
    }

}

package com.Testing;

import static org.junit.Assert.*;

import java.io.IOException;
import java.util.ArrayList;
import java.util.List;

import org.junit.Test;


import com.CustomClasses.FunktionForTesting;
//Remember that myBoard in board should be public and all properties in Piece should also be public
import com.OriginalFiles.*;

import custom.Exceptions.IllegalMove;
import custom.Exceptions.NoKingLeft;

public class BoardTest extends FunktionForTesting {
	
	public BoardTest () throws InterruptedException, IOException
	{
	    super();
	}
	
	@Test
	//test for the Board class' constructor
	public void testBoard(){
		for(int x = 0; x < 8; x++){
			for(int y = 0; y < 8; y++){
				Field temp = checkersBoard.myBoard[x][y];
				if((x+y)%2 == 1)
				{
					assertTrue(temp.x == x);
					assertTrue(temp.y == y);
					assertTrue(temp.allowedField);
					
					//test if the robots piece is piece and have the right values
					if(y < 3)
					{
						assertNotNull(temp.getPieceOnField());
						assertTrue(temp.getPieceOnField().getX() == x);
						assertTrue(temp.getPieceOnField().getY() == y);
						assertEquals('r',temp.getPieceOnField().color);

						if(y == 2)
						{
							//test if the robots first row is movable and not kings
							assertTrue(temp.getPieceOnField().isMoveable);
							assertFalse(temp.getPieceOnField().isCrowned);
						}
					}

					//Same procedure for the human players pieces
					if(y > 4)
					{
						assertNotNull(temp.getPieceOnField());
						assertTrue(temp.getPieceOnField().getX() == x);
						assertTrue(temp.getPieceOnField().getY() == y);
						assertEquals('w',temp.getPieceOnField().color);
						
						if(y==5)
						{
							assertTrue(temp.getPieceOnField().isMoveable);
							assertFalse(temp.getPieceOnField().isCrowned);
						}
					}
					
					if(y >= 3 && y <= 4){
						assertNull(temp.getPieceOnField());
					}
				}
				else
				{
					//test if the all the white fields are not allowed to move on
					assertFalse(temp.allowedField);
				}
			}
		}
	}
	
	

	@Test
	public void testMovePiece() throws NoKingLeft, IOException, custom.Exceptions.NoKingLeft {
		Piece temp = checkersBoard.myBoard[2][5].getPieceOnField();
		
		//test if the representation is updated probably
		checkersBoard.movePieceInRepresentation(checkersBoard.myBoard[2][5], checkersBoard.myBoard[3][2], false);

		assertEquals(temp, checkersBoard.myBoard[3][2].getPieceOnField());
		assertNull(checkersBoard.myBoard[2][5].getPieceOnField());
		
		checkersBoard.movePieceInRepresentation(checkersBoard.myBoard[1][2], produceField(8,8), false);
		
		assertNull(checkersBoard.myBoard[1][2].getPieceOnField());
	}

	@Test
	public void testFieldOccupied() {
		//test to see whether this function return is occupied if the field has a piece or if it is outside the board
		assertTrue(checkersBoard.fieldOccupied(1, 0));
		assertFalse(checkersBoard.fieldOccupied(2, 3));
		assertTrue(checkersBoard.fieldOccupied(9, 9));
	}
	
	//function to produce a list of fields which are used for testing check moveable function
	private List<Field> produceList(Field field, int direction){
		List<Field> result = new ArrayList<Field>();
		
		if(field.y +direction <= 7 && field.y +direction >= 0){
			if(field.x == 0){
				result.add(checkersBoard.myBoard[field.x+1][field.y+direction]);
			}
			else if(field.x == 7){
				result.add(checkersBoard.myBoard[field.x-1][field.y+direction]);
			}
			else{
				result.add(checkersBoard.myBoard[field.x-1][field.y+direction]);
				result.add(checkersBoard.myBoard[field.x+1][field.y+direction]);
			}
		}
		
		return result;
	}	
	
	@Test
	public void testCheckMoveable() throws InterruptedException, IOException {
		//test whether this function results lists corresponding the to the valid moves
		List<Field> tempList = produceList(checkersBoard.myBoard[2][5],-1);
		
		assertEquals(checkersBoard.checkMoveable(checkersBoard.myBoard[2][5], -1),tempList);
		
		checkersBoard.myBoard[2][5].getPieceOnField().isCrowned = true;
		
		assertEquals(checkersBoard.checkMoveable(checkersBoard.myBoard[2][5], -1),tempList);
		
		tempList = produceList(checkersBoard.myBoard[0][5],-1);
		
		assertEquals(checkersBoard.checkMoveable(checkersBoard.myBoard[0][5], -1),tempList);
		
		tempList = produceList(checkersBoard.myBoard[7][2],1);
		
		assertEquals(checkersBoard.checkMoveable(checkersBoard.myBoard[7][2], 1),tempList);
		
		checkersBoard.myBoard[7][2].getPieceOnField().isCrowned = true;
		
		assertEquals(checkersBoard.checkMoveable(checkersBoard.myBoard[7][2], 1),tempList);
		
		resetBoard();
	}
	
	@Test
	public void testCheckJumpDirection() throws InterruptedException, IOException {
		//test if this function returns the fields allowed for a piece to jump too
	    checkersBoard.myBoard[3][4].setPieceOnField(producePiece(0,0,'r',false));
		
		assertEquals(checkersBoard.checkJumpDirection(checkersBoard.myBoard[4][5], -1, -1, false, false), checkersBoard.myBoard[2][3]);
		assertNull(checkersBoard.checkJumpDirection(checkersBoard.myBoard[4][5], 1, -1, false, false));
		
		checkersBoard.myBoard[3][4].getPieceOnField().isCrowned = true;
		checkersBoard.myBoard[4][3].setPieceOnField(producePiece(4, 3,'w',false));
		checkersBoard.myBoard[5][2].emptyThisField();
		
		assertEquals(checkersBoard.checkJumpDirection(checkersBoard.myBoard[3][4], 1, -1, true, true), checkersBoard.myBoard[5][2]);
		assertNull(checkersBoard.checkJumpDirection(checkersBoard.myBoard[3][4], -1, -1, true, true));
		
		resetBoard();
	}

	@Test
	public void testCheckAllegiance() {
		//Test for humans pieces
		assertTrue(checkersBoard.checkAllegiance(checkersBoard.myBoard[4][5], true));
		assertFalse(checkersBoard.checkAllegiance(checkersBoard.myBoard[4][5], false));
		
		//Test for robots pieces
		assertTrue(checkersBoard.checkAllegiance(checkersBoard.myBoard[2][1], false));
		assertFalse(checkersBoard.checkAllegiance(checkersBoard.myBoard[2][1], true));
		
		Field checkField = produceField(9,9);
		
		//Test for out for bounds
		assertFalse(checkersBoard.checkAllegiance(checkField,true));
		assertFalse(checkersBoard.checkAllegiance(checkField,false));
	}

}

package com.Testing;

import static org.junit.Assert.*;
import java.io.IOException;
import org.junit.Test;
import com.CustomClasses.FunktionForTesting;
import custom.Exceptions.IllegalMove;
import custom.Exceptions.NoKingLeft;

public class AnalyzeTest extends FunktionForTesting {
    com.OriginalFiles.Analyze analyzeForTest;
    public AnalyzeTest() throws InterruptedException, IOException {
        super();
        analyzeForTest = checkersBoard.analyzeFunctions;
        // TODO Auto-generated constructor stub
    }

    @Test
    public final void testGameHasEnded() throws InterruptedException, IOException {
        //test if the game is not ended with start positioning
        assertEquals(0, analyzeForTest.gameHasEnded(true));
        assertEquals(0, analyzeForTest.gameHasEnded(false));

        constructWinCase(true);
        //test if the game registers that the human have won independent of whos turn it is
        assertEquals(1, analyzeForTest.gameHasEnded(true));
        assertEquals(1, analyzeForTest.gameHasEnded(false));
        
        constructWinCase(false);
        //test if the game registers that the robot have won independent of whos turn it is
        assertEquals(2, analyzeForTest.gameHasEnded(true));
        assertEquals(2, analyzeForTest.gameHasEnded(false));
        
        emptyBoard();
        
        //test if the game ended when it is a draw when it is humans turn
        //test if the game is not ended when it is the robots turn
        checkersBoard.myBoard[4][5].setPieceOnField(producePiece(4, 5, 'b', true));
        checkersBoard.myBoard[6][7].setPieceOnField(producePiece(4, 5, 'g', true));
        
        assertEquals(3, analyzeForTest.gameHasEnded(true));
        assertNotEquals(3, analyzeForTest.gameHasEnded(false));
        
        emptyBoard();
        
        //test if the game ended when it is a draw when it is robots turn
        //test if the game is not ended when it is the human turn
        checkersBoard.myBoard[1][0].setPieceOnField(producePiece(4, 5, 'b',true));
        checkersBoard.myBoard[1][2].setPieceOnField(producePiece(4, 5, 'g',true));
        
        assertEquals(3, analyzeForTest.gameHasEnded(false));
        assertNotEquals(3, analyzeForTest.gameHasEnded(true));
        
        resetBoard();
    }

    

    

    @Test
    public final void testCheckForGameHasEnded() throws InterruptedException, IOException {
        
        //test if the games ends in the different scenarios
        assertFalse(analyzeForTest.checkForGameHasEnded(true));
        assertFalse(analyzeForTest.checkForGameHasEnded(false));
        
        constructWinCase(true);
        
        assertTrue(analyzeForTest.checkForGameHasEnded(true));
        assertTrue(analyzeForTest.checkForGameHasEnded(false));
        
        constructWinCase(false);
        
        assertTrue(analyzeForTest.checkForGameHasEnded(true));
        assertTrue(analyzeForTest.checkForGameHasEnded(false));
        
        emptyBoard();
        
        //draw case if humans turn
        checkersBoard.myBoard[4][5].setPieceOnField(producePiece(4, 5, 'b',true));
        checkersBoard.myBoard[6][7].setPieceOnField(producePiece(6, 7, 'g',true));
        
        assertTrue(analyzeForTest.checkForGameHasEnded(true));
        assertFalse(analyzeForTest.checkForGameHasEnded(false));
        
        emptyBoard();
        
        //draw case if robots turn
        checkersBoard.myBoard[1][0].setPieceOnField(producePiece(1, 0, 'b',true));
        checkersBoard.myBoard[1][2].setPieceOnField(producePiece(1, 2, 'g',true));
        
        assertTrue(analyzeForTest.checkForGameHasEnded(false));
        assertFalse(analyzeForTest.checkForGameHasEnded(true));
        
        resetBoard();
    }
    
    @Test
    public final void testAnalyzeBoard() throws InterruptedException, IOException, NoKingLeft, IllegalMove, custom.Exceptions.NoKingLeft, custom.Exceptions.IllegalMove{
        boolean testException = false;
        
        //test if analyzeboard works when moving a piece
        assertTrue(analyzeForTest.analyzeBoard());
        
        //production of an illegal move
        checkersBoard.myBoard[3][4].setPieceOnField(producePiece(4, 5, 'r',false));
        checkersBoard.myBoard[2][5].setPieceOnField(producePiece(4, 5, 'w',true));
        
        //test that analyzeBoard finds and reports the illegal move
        try {
            analyzeForTest.analyzeBoard();
        }
        catch (IllegalMove e) {
            testException = true;
        }
        
        assertTrue(testException);
        
        resetBoard();
    }
    
    
    //Test not that valid for the real GetColor function
    @Test
    public final void testGetColor() throws IOException {
        assertEquals(checkersBoard.myBoard[1][0].getPieceOnField().color, analyzeForTest.getColor(1, 0));
        assertEquals(' ', analyzeForTest.getColor(0, 3));
        assertEquals('w', analyzeForTest.getColor(1,4));
    }
}
